Text:
Thank you 
@hippodigitaluk
 for the talk on adapting user research to overcome the challenges during COVID! Hearing about how we can reduce the impact of research on participants and solving the issues around having different notetakers and notetaking styles was particularly useful

Thank you 
@MadeBrave
 for a great webinar about relaunch roadmapping after covid. 10 great tips learnt (even if illegible to most in my quick notetaking!)
